package whileloop;

public class whileloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[]intArray = new int[5];
		intArray[0] = 25000;
		intArray[1] = 35000;
		intArray[2] = 45000;
		intArray[3] = 55000;
		intArray[4] = 65000;
		int i = 0;
		while(i<5) {
			System.out.println(intArray[i]);
			i++;
		}
		
		

	}

}
